import React from "react";
import { Link } from "react-router-dom";

import bookblog from "../imgs/projects/book-blog.png";
import recipebox from "../imgs/projects/recipe-box.png";
import wikipediaviewer from "../imgs/projects/wikipdia-viewer.png";

const Projects = () => {
  return (
    <div id="projects">
      <h2>Projects</h2>
      <Link to="/recipe-box" target="_blank">Recipe Box</Link>
      <Link to="/wikipedia-viewer" target="_blank">Wikipedia Article Searcher</Link>
      <Link to="/book-blog" target="_blank"><img src={bookblog} /></Link>
    </div>
  );
};

export default Projects;
